import React from 'react'
import {
    Box, Heading
} from '@chakra-ui/react'


function Overview(){
    return(
        <Box>
            <Heading
            color="hsl(228, 12%, 44%)"
            fontWeight="black"
            fontSize="md"
            >Overview - Today</Heading>
        </Box>
    )
}

export default Overview
